import { Component } from "react";
import { Carousel } from "react-bootstrap";

class MovieSlider extends Component {
  render() {
    return (
      <div>
        <div class="carousel-item">
          <div class="movie-row">
            <div id="Comedy2" class="row"></div>
          </div>
        </div>
      </div>
    );
  }
}

export default MovieSlider;
